import React from "react";
import ProductList from "../Products/ProductList";
import Title from './Title';
import SearchBar from "./SearchBar";

const Home = (props) => {
  const {products, onAdd} = props;
  return (
    <main>
      <SearchBar />
      <Title/>
      <ProductList products={products || []} onAdd={onAdd}/>
    </main>
  );
};
export default Home;
